function buildView(element, props) {
	var country1 = props.country1;
	var year2 = props.year2;

	// Retrieve the entry at companions_j[country1][year2]
	var country2 = "";
	var GDP = 0;
	var i = 0;
	while (i < companions_j.length) {
		if (companions_j[i].year2 === year2) {
			if (companions_j[i].country1 === country1) {
				country2 = companions_j[i].country2;
				GDP = companions_j[i].GDP;
			}
			i = i + (2019-1960);  // if right year and wrong country, start jumping ahead by 2019-1960+1.
		}
		i++;
	}

  // Select the right country for each layer.
  const query1 = ('datum.country ==="')
      .concat(country1)
      .concat('"');
  const query2 = ('datum.country ==="')
      .concat(country2)
      .concat('"');
  spec.layer[0].transform[0].filter = query1;
  spec.layer[1].transform[0].filter = query2;
  spec.layer[2].transform[0].filter = query2;


  // Select the right years for the country 2 plots.
  var query_year = ('datum.year <=').concat(year2.toString())
  spec.layer[1].transform[1].filter = ('datum.year <=').concat(year2.toString());
  spec.layer[2].transform[1].filter = ('datum.year >=').concat(year2.toString());

  // Update the domain for legend colors (country~color)
  // (Remember, actual colors are hard-coded)
  spec.layer[0].encoding.color.scale.domain = [country1, country2];
  spec.layer[1].encoding.color.scale.domain = [country1, country2];

  
  // Relocate the guiding lines
  spec.layer[3].data.values = [{"x":year2, "y":0},{"x":year2,"y":GDP}];
  spec.layer[4].data.values = [{"x":2019, "y":0},{"x":2019,"y":GDP}];
  spec.layer[5].data.values = [{"x":year2, "y":GDP},{"x":2019,"y":GDP}];


  // Scale the y-axis and cut off values that are too high.
  spec.layer[0].encoding.y.scale.domain[1] = 2.8*GDP;
  spec.layer[2].transform[2].filter = ('datum.GDP <=').concat((2.8*GDP).toString());

  // // For debugging:
  // alert(JSON.stringify(Object.values(spec)));

  
  var tooltip = new vegaTooltip.Handler();
  var runtime = vega.parse(vegalite.compile(spec).spec)
  var view = new vega.View(runtime)
    .renderer('svg')
    .initialize(element.node())
    .tooltip(tooltip.call);

  return view;
}
class Buddies extends D3Component {
  initialize(root, props) {
    this.element = d3.select(root);
    buildView(this.element, props).run();
  }

  update(props, oldProps) {
    buildView(this.element, props).run();
  }
}

module.exports = Buddies;